-- Los años comienzan en 2018
-- Para 2020-21, hay que sumar 2 años
-- Se resta 1 mes para que queden, como mucho, a primeros de Febrero de 2021
UPDATE VENTA
--SET FECHA = FECHA + interval '2 year' - interval '1 month';
SET FECHA = FECHA + interval '4 year'; -- Para Marzo 2023

-- Asignamos a las ventas un id de empleado aleatorio
UPDATE VENTA
SET ID_EMPLEADO = (floor(random() * 100 + 1))::integer;


-- Actualizamos el precio de las lineas de venta
-- al precio del producto

UPDATE LINEAVENTA LV
SET PRECIO_UNITARIO = (SELECT PVP 
              FROM PRODUCTO 
              WHERE LV.ID_PRODUCTO = PRODUCTO.ID);
              

-- Actualizamos la venta con el nº de artículos
-- y el total

UPDATE VENTA V1
SET (PRECIO_TOTAL, NUMERO_ARTICULOS) = 
        (SELECT
        SUM(PRECIO_UNITARIO *(1 - COALESCE(DESCUENTO, 0)) * CANTIDAD) P_TOTAL,
        SUM(CANTIDAD) N_TOTAL
    FROM
        VENTA V2
        JOIN LINEAVENTA ON ( LINEAVENTA.ID_VENTA = V2.ID )
    WHERE V2.ID = V1.ID
    GROUP BY
        V2.ID);




